import React, { useEffect, useState } from "react";
import axios from "axios";
export default function FormSubmissions() {
  const [forms, setForms] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/forms/getforms").then((res) => {
      // console.log(res);

      setForms(res.data);
    });
    //console.log(forms);

    //console.log(forms);
  }, []);

  useEffect(() => {
    console.log(forms);

    //console.log(forms);
  }, [forms]);

  return (
    <div>
      <table>
        <tr
          style={{ padding: "7px", align: " left", border: "1px solid #ddd" }}
        >
          <td style={{ padding: "7px", align: " left" }}>field label</td>
          <td style={{ padding: "7px", align: " left" }}> input name</td>
          <td style={{ padding: "7px", align: " left" }}>input type</td>
        </tr>
      </table>
      {forms.map((form) => {
        return (
          <table>
            <tr style={{ padding: "20px", align: " left" }}>
              <td style={{ padding: "20px", align: " left" }}>
                {form.fieldLabel}
              </td>
              <td style={{ padding: "20px", align: " left" }}>
                {form.inputName}
              </td>
              <td style={{ padding: "20px", align: " left" }}>
                {" "}
                {form.inputType}
              </td>
            </tr>
          </table>
        );
      })}
    </div>
  );
}
